import React from 'react';
import GroceryItem from './GroceryItem';

function App() {
  function handleClick(item) {
    alert(`${item} has been added to your cart`);
  }
  return (
    <div>
      <GroceryItem onClick={handleClick} name="Eggs"/>
      <GroceryItem onClick={handleClick} name="Banana"/>
      <GroceryItem onClick={handleClick} name="Strawberry"/>
      <GroceryItem onClick={handleClick} name="Eggs"/>
    </div>
  );
}

export default App;
